import React from 'react';

class ContactPage extends React.Component {
    
    constructor(props){
        super(props);
        this.state = {
            name: '',
            email: '',
            message: '',
            disable: false,
            emailsent: null,
        }
    }

    render(){
        return(
            <div>
                <Hero title={this.props.title} />
            </div>
        );
    }

}

export default ContactPage;
